import React from "react";

function Header() {
  return (
    <nav className="flex flex-wrap items-center justify-between p-6 bg-white">
				<div className="flex items-center flex-shrink-0 mr-6 text-red-500">
					<span className="text-xl font-bold">Sorting Hat</span>
				</div>
        <div className="flex items-center flex-shrink-0 mr-6 text-white">
					<a
						href="#"
						className="inline-block px-4 py-2 mt-4 text-sm leading-none text-black border border-white rounded hover:border-transparent hover:bg-red-500 md:mt-0"
					>
						about
					</a>
          <a className="inline-block px-4 py-2 mt-4 text-sm leading-none text-white border border-white rounded hover:border-transparent hover:text-blue-500 hover:bg-white md:mt-0">
            take quiz
          </a>
				</div>
			</nav>
  );
}

export default Header;
